commit_message:
Format modifications for "--no-property"

* Move option "--no-property" above "--property" in aggregate;
  Update help message of "--no-property" option.
* Remove unnecessary for-loop in flavor;
* Remove weird spacing in the ymal of volume snapshot set;
* Add format for options in doc by ":option:`--xxx`" in flavor.rst
Change-Id: I21871188b3a9e0846ed90d1bb6097b8c35aeebc0
